script: |
  super -f text -I q9561.spq | sort > q9561.out

inputs:
  - name: q9561.spq
    data: |
      SELECT + + 9, col0 + + ( + ( - col2 ) ) * + col1 / - + 86 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - CAST ( - 42 AS REAL ) + - + col0 * - 4 / + - col1 <> + + 66;
  - name: tab0

outputs:
  - name: q9561.out
    data: |
